  false,\n\t\"url\": null,\n\t\"notes\": \"The Trail of the Coeur d' Alenes is one
  of the most spectacular and popular trails in the Western United States. The trail
  contains 73 miles of well-maintained asphalt that perfect for road bicyclists and
  in-line skaters. The Trail of the Coeur d' Alenes nearly spans the Idaho Panhandle
  as it runs along rivers, beside lakes and through the Silver Valley. The trail is
  part of the environmental cleanup in a partnership between Union Pacific Railroad,
  the U.S. Government, the State of Idaho, and the Coeur d' Alene Tribe.\",\n\t\"owner_org\":
